    <Card>
      {/* TABS */}
      <br></br>
      {/* MAIN CONTENT CONTAINER */}
      <form>
        <div
          sx={{
            p: 3,
            maxHeight: { md: "40vh" },
            textAlign: { xs: "center", md: "start" }
          }}
        ></div>
          {/* FIELDS */}
          <span >
            <div
              direction={{ xs: "column", md: "row" }}
              columnSpacing={5}
              rowSpacing={3}></div>
            </span>
              {/* ROW 1: FIRST NAME */}
              <div
                  id="firstName"
                  name="firstName"
                  value={user.firstName}
                  onChange={changeField}
                  title="First Name"
                  dis={edit.disabled}
                  req={edit.required}
                >
              </div>
              

              {/* ROW 1: LAST NAME */}
              <div component="form">
                <span
                  id="lastName"
                  name="lastName"
                  value={user.lastName}
                  onChange={changeField}
                  title="Last Name"
                  dis={edit.disabled}
                  req={edit.required}
                ></span>
              </div>
              {/* ROW 3: PHONE */}
              <div >
                <span
                  id="phone"
                  name="phone"
                  value={user.phone}
                  onChange={changeField}
                  title="Phone Number"
                  dis={edit.disabled}
                  req={edit.required}
                  //DIALING CODE
                  InputProps={{
                    startAdornment: (
                      <InputAdornment position="start">63+</InputAdornment>
                    )
                  }}
               > </span>
              </div>

              {/* ROW 3: EMAIL */}
              <div>
                <span
                  type="email"
                  id="email"
                  name="email"
                  value={user.email}
                  onChange={changeField}
                  title="Email Address"
                  dis={edit.disabled}
                  req={edit.required}
                ></span>
              </div>

              {/* ROW 4: PASSWORD */}
              <div >
                <span
                  id="pass"
                  name="pass"
                  value={user.pass}
                  onChange={changeField}
                  title="Password"
                  dis={edit.disabled}
                  req={edit.required}
                  type={user.showPassword ? "text" : "password"}
                  // PASSWORD ICON
                  InputProps={{
                    endAdornment: (
                      <InputAdornment position="end">
                        <IconButton
                          onClick={handlePassword}
                          edge="end"
                          disabled={edit.disabled}
                        >
                          {user.showPassword ? (
                            <VisibilityOff />
                          ) : (
                            <Visibility />
                          )}
                        </IconButton>
                      </InputAdornment>
                    )
                  }}
                ></span>
              </div>

              {/* BUTTON */}
              <div
                container
                justifyContent={{ xs: "center", md: "flex-end" }}
                item
                xs={6}
              >
                <Button
                  sx={{ p: "1rem 2rem", my: 2, height: "3rem" }}
                  component="button"
                  size="large"
                  variant="contained"
                  color="secondary"
                  onClick={() => props.expose("hello")}
                >
                  {edit.isEdit === false ? "UPDATE" : "EDIT"}
                </Button>
              </div>
            
      </form>
    </Card>



